query BoatsQueryByPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    html
    frontmatter {
      type
      name
      path
    }
  }
}

query BlogPostByPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    html
    frontmatter {
      date
      title
      path
    }
  }
}

query TeamsQuery {
  allMarkdownRemark(filter: {frontmatter: {topChoice: {eq: "yes"}}}) {
    edges {
      node {
        frontmatter {
          type
          name
          path
        }
        excerpt(pruneLength: 300)
      }
    }
  }
}

